import React from 'react';
import back from './Images/Component 15 – 1.png'
import front from './Images/Component 14 – 1.png'
const About=(props)=>{
    return(
<>
<div className="container-fluid mb-5">
    <div className="row">
    <img src={back} className="back"/>
    <div className="col-10 mx-auto">
    <div className="row gy-4">
        <img src={front} className="back"/>
    </div>
    </div>
    </div>
</div>

</>
    );
};
export default About;
